import React from "react";
import { Container, FormControlLabel, Typography } from "@mui/material";
import {
  CompanyName,
  Content,
  Label,
  LabelWrapper,
  Logo,
  PageContent,
} from "./styles";
import FacebookIcon from "@mui/icons-material/Facebook";
import InstagramIcon from "@mui/icons-material/Instagram";
import TwitterIcon from "@mui/icons-material/Twitter";

import ComapnyLogo from "./logo.svg";
import "./App.css";
import { Box } from "@mui/system";

function App() {
  return (
    <Container
      sx={{ backgroundColor: "rgb(243,246,249)", height: "100vh" }}
      maxWidth="xl"
    >
      <PageContent
        sx={{
          // backgroundColor: "red",
          height: "100%",
          display: "flex",
          flexDirection: "column",
          // justifyContent: "center",
        }}
      >
        <Logo src={ComapnyLogo} alt="comapny_logo" />
        <Box sx={{ display: "flex", justifyContent: "center" }}>
          <Typography fontFamily={"cursive"} variant="h2" gutterBottom>
            Company Name
          </Typography>
        </Box>
        <Box
          sx={{
            backgroundColor: "red",
            // height: "100%",
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
          }}
        >
          <Typography variant="h3" gutterBottom>
            CONTACT US
          </Typography>
          <LabelWrapper>
            <Label variant="h6"> Email:</Label>
            <Content variant="h6">comapny-name.test@hotmail.com</Content>
          </LabelWrapper>
          <LabelWrapper>
            <Label variant="h6"> Phone:</Label>
            <Content variant="h6">01/ 345 678</Content>
          </LabelWrapper>
          <LabelWrapper>
            <Label variant="h6"> Address:</Label>
            <Content variant="h6">
              Fakhreddine st, Minet el Hosn, Beirut, Lebanon
            </Content>
          </LabelWrapper>
          <Box
            sx={{
              width: "25%",
              // paddingTop: "20px",
              display: "flex",
              // paddingLeft: "15px",
              justifyContent: "space-evenly",
            }}
          >
            <FacebookIcon />
            <InstagramIcon />
            <TwitterIcon />
          </Box>
        </Box>
      </PageContent>
    </Container>
  );
}

export default App;
